function App() {

  const [data, setData] = useState(JobData)

  const JobCard = data.map((items) => {

    return (<Card key={items.id} Data={items} />)
  }
  )
  return (
    <div className="App">
      <header className="App-header">
        <img src={headerImg} alt="pic" />
      </header>
      <div className='Jo'>
        <div>
        <p></p>
        </div>
        <p>Clear</p>
      </div>

      <div className='Jobs'>
          {JobCard}
      </div>


    </div>
  );
}

export default App;
